export const ProductsTable = (props) => {
  const {
    nameOfColumn, //jdjv
    dataOfRows,
    placeholder_searchBox,
    go_where, //this icon ➕ link to where - hamishe ham link nist
    operation,
    show_addButton,
    show_compo,
    having_searchBox,
  } = props;
  return (
    <div>
      <table>
        <thead>
          {nameOfColumn.map((item) => (
            <th>
              <td>{item}</td>
            </th>
          ))}
        </thead>
        <tbody>
          {dataOfRows.map((data) => (
            <tr>
              <td>{data.id}</td>
              <td>{data.title}</td>
              <td>{data.descriptions}</td>
              <td>{data.created_at}</td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};
